"use strict";(self.webpackChunkef_website_template=self.webpackChunkef_website_template||[]).push([[935],{3543:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2022/12/02/blog","metadata":{"permalink":"/EF-Informatik/2022/12/02/blog","editUrl":"https://github.com/mcdelarosa/EF-Informatik/tree/main/blog/2022-12-02-blog.md","source":"@site/blog/2022-12-02-blog.md","title":"blog","description":"Ein einwandfreier Tag","date":"2022-12-02T00:00:00.000Z","formattedDate":"2. Dezember 2022","tags":[],"readingTime":0.47,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"nextItem":{"title":"blog","permalink":"/EF-Informatik/2022/11/30/blog"}},"content":"Ein einwandfreier Tag\\n---\\nAm heutigen Tag war Herr Hofer krank, deshalb waren wir allein im Klassenzimmer. \\\\\\nMan k\xf6nnte fast sagen, dass wir allein waren, da die Meisten keine Schule am Nachmittag hatten. \\\\\\nUnsere Auftr\xe4ge waren im Grunde wenig und kurz, doch das war nicht der Fall.\\nZeit habe ich verbracht um erst nur eine Aufgabe zu verstehen und noch weiter damit ich das Programm zum Laufen bringe...\\\\\\nHabe noch Gl\xfcck gehabt, dass ich damit fertig bin, sonst w\xfcrde ich irrewerden!\\\\\\nEin weiterer Problem ist immernoch das Hochladen der Dokumente auf GitHub..."},{"id":"/2022/11/30/blog","metadata":{"permalink":"/EF-Informatik/2022/11/30/blog","editUrl":"https://github.com/mcdelarosa/EF-Informatik/tree/main/blog/2022-11-30-blog.md","source":"@site/blog/2022-11-30-blog.md","title":"blog","description":"Stolze Arbeit","date":"2022-11-30T00:00:00.000Z","formattedDate":"30. November 2022","tags":[],"readingTime":0.435,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"blog","permalink":"/EF-Informatik/2022/12/02/blog"},"nextItem":{"title":"blog","permalink":"/EF-Informatik/2022/11/29/blog"}},"content":"Stolze Arbeit\\n---\\nMit Hilfe, weil ich f\xfcr lange stecken blieb, habe ich es geschafft das Numtrip endlich laufen zu bringen.\\\\\\nVieles war unn\xf6tig und konnte verk\xfcrzt/vereinfacht werden, was ich auch tat.\\\\\\nAls alles unn\xf6tige ersetzt wurde, war mein Code sowohl k\xfcrzer als auch verst\xe4ndlicher geworden und das hatte mir auch erleichtert.\\\\\\nEine wichtige \xc4nderung war die Tabelle des Numtrips, da habe ich versucht die Symbolen zu l\xf6schen, da diese\\ndie Tabelle nicht proportional machten. Jetzt wird alles mit verschiedenen Farben angezeigt anstatt dieser Versuch einer Tabelle"},{"id":"/2022/11/29/blog","metadata":{"permalink":"/EF-Informatik/2022/11/29/blog","editUrl":"https://github.com/mcdelarosa/EF-Informatik/tree/main/blog/2022-11-29-blog.md","source":"@site/blog/2022-11-29-blog.md","title":"blog","description":"Ein Auf und Ab!","date":"2022-11-29T00:00:00.000Z","formattedDate":"29. November 2022","tags":[],"readingTime":0.455,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"blog","permalink":"/EF-Informatik/2022/11/30/blog"},"nextItem":{"title":"datenstruktur","permalink":"/EF-Informatik/2022/11/29/numtrip/datenstruktur"}},"content":"Ein Auf und Ab!\\n---\\nWegen letzter Woche war ich \\"frustriert\\", da ich zu wenig erledigt hatte. Es hat sich festgestellt, dass ich etwas nicht verstanden hatte, aber dies schien mir nicht so, als ich das \\"gelernt\\" hatte.\\nAlles nur weil ich `.split()` nicht verstanden hatte. Jetzt ist mir alles klargeworden. \\\\\\nDas Numtrip ist auch m\xfchsam, doch man braucht immer eine Challenge, um zu lernen, sonst g\xe4be es kein Grund schwieriges zu l\xf6sen!\\\\\\nIch habe festgestellt, dass GitHub manchmal Schwierigkeiten hat etwas hochzuladen...\\nDas muss ich mit Herr Hofer anschauen."},{"id":"/2022/11/29/numtrip/datenstruktur","metadata":{"permalink":"/EF-Informatik/2022/11/29/numtrip/datenstruktur","editUrl":"https://github.com/mcdelarosa/EF-Informatik/tree/main/blog/numtrip/2022-11-29-datenstruktur.md","source":"@site/blog/numtrip/2022-11-29-datenstruktur.md","title":"datenstruktur","description":"img1.png","date":"2022-11-29T00:00:00.000Z","formattedDate":"29. November 2022","tags":[],"readingTime":0.01,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"blog","permalink":"/EF-Informatik/2022/11/29/blog"},"nextItem":{"title":"Wiedereinstieg in Python","permalink":"/EF-Informatik/2022/08/26/blog"}},"content":"![img_1.png](img_1.png)\\n![Numtrip1.jpeg](Numtrip1.jpeg)"},{"id":"/2022/08/26/blog","metadata":{"permalink":"/EF-Informatik/2022/08/26/blog","editUrl":"https://github.com/mcdelarosa/EF-Informatik/tree/main/blog/2022-08-26-blog.md","source":"@site/blog/2022-08-26-blog.md","title":"Wiedereinstieg in Python","description":"Das heutige Thema war Python/Tigerjython was mir nicht wirklich gef\xe4llt, da das nur eine Bibliothek,","date":"2022-08-26T00:00:00.000Z","formattedDate":"26. August 2022","tags":[],"readingTime":0.395,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"prevItem":{"title":"datenstruktur","permalink":"/EF-Informatik/2022/11/29/numtrip/datenstruktur"}},"content":"Das heutige Thema war Python/Tigerjython was mir nicht wirklich gef\xe4llt, da das nur eine Bibliothek,\\ndie keiner im Alltag braucht und nutzlos ist.\\n\\n# Tigerjython ist doof\\n\\nNichtsdestotrotz habe ich einen, in meinen Augen, super Code programmiert, und zwar das ZickZack Programm\\nim ersten Kapitel:\\n```py\\nfrom turtle import *\\ncolor = [\\"red\\", \\"orange\\", \\"lime\\"]\\npensize = 5\\nright(60)\\nfor x in color:\\n    left(120)\\n    pencolor(x)\\n    forward(20)\\n    right(120)\\n    forward(20)\\n```\\n\\nHat eine gr\xf6ssere Aufwendung gebraucht, doch es hat sich gelohnt."}]}')}}]);